__attribute__((device)) __inline__ int selectMSAACentroid(int samplesLog2, U32 sampleMask)
{
    int numSamples = 1 << samplesLog2;
    if (sampleMask == 0 || sampleMask == (1u << numSamples) - 1)
        return -1;

    int bestSample = -1;
    int bestDist = (0x7FFFFFFF);
    for (int i = 0; i < numSamples; i++)
    {
        if ((sampleMask & (1 << i)) != 0)
        {
            int dist = sqr(c_msaaPatterns[samplesLog2][i] * 2 + 1 - numSamples) + sqr(i * 2 + 1 - numSamples);
            if (dist < bestDist)
            {
                bestSample = i;
                bestDist = dist;
            }
        }
    }
    return bestSample;
}



__attribute__((device)) __inline__ U32 cover8x8_selectFlips(S32 dx, S32 dy)
{
    U32 flips = 0;
    if (dy > 0 || (dy == 0 && dx <= 0))
        flips ^= (1 << 3) ^ (1 << 2) ^ (1 << 5);
    if (dx > 0)
        flips ^= (1 << 3) ^ (1 << 2);
    if (::abs(dx) < ::abs(dy))
        flips ^= (1 << 4) ^ (1 << 2);
    return flips;
}



__attribute__((device)) __inline__ int clipPolygonWithPlane(F32* baryOut, const F32* baryIn, int numIn, F32 v0, F32 v1, F32 v2)
{
    int numOut = 0;
    if (numIn >= 3)
    {
        int ai = (numIn - 1) * 2;
        F32 av = v0 + v1 * baryIn[ai + 0] + v2 * baryIn[ai + 1];
        for (int bi = 0; bi < numIn * 2; bi += 2)
        {
            F32 bv = v0 + v1 * baryIn[bi + 0] + v2 * baryIn[bi + 1];
            if (av * bv < 0.0f)
            {
                F32 bc = av / (av - bv);
                F32 ac = 1.0f - bc;
                baryOut[numOut + 0] = baryIn[ai + 0] * ac + baryIn[bi + 0] * bc;
