    pleq.x = (U32)(xc >> (rcpShift - (sh + 4 - samplesLog2)));
    pleq.y = (U32)(yc >> (rcpShift - (sh + 4 - samplesLog2)));

    S32 centerX = (v0.x * 2 + min_min(d1.x, d2.x, 0) + max_max(d1.x, d2.x, 0)) >> (4 - samplesLog2 + 1);
    S32 centerY = (v0.y * 2 + min_min(d1.y, d2.y, 0) + max_max(d1.y, d2.y, 0)) >> (4 - samplesLog2 + 1);
    S32 vcx = v0.x - (centerX << (4 - samplesLog2));
    S32 vcy = v0.y - (centerY << (4 - samplesLog2));

    pleq.z = t0 << sh;
    pleq.z -= (U32)(((xc >> 13) * vcx + (yc >> 13) * vcy) >> (rcpShift - (sh + 13)));
    pleq.z -= pleq.x * centerX + pleq.y * centerY;
    return pleq;
}



__attribute__((device)) __inline__ U64 cover8x8_exact_ref(S32 ox, S32 oy, S32 dx, S32 dy)
{
