__attribute__((device)) __inline__ void cover8x8_setupLUT(volatile U64* lut)
{
    for (S32 lutIdx = threadIdx.x + blockDim.x * threadIdx.y; lutIdx < 768; lutIdx += blockDim.x * blockDim.y)
    {
        int half = (lutIdx < (12 << 5)) ? 0 : 1;
