        U64 mask = 0;
        int xlo = half * 4;
        int xhi = xlo + 4;
        for (int x = xlo; x < xhi; x++)
        {
            int ylo = slct(0, ::max(yint, 0), slctCompl);
            int yhi = slct(::min(yint, 8), 8, slctCompl);
            for (int y = ylo; y < yhi; y++)
            {
                int xx = slct(x, y, slctSwapXY);
                int yy = slct(y, x, slctSwapXY);
                xx = slct(xx, 7 - xx, slctNegX);
                mask |= (U64)1 << (xx + yy * 8);
            }
            yint += shape >> 31;
            shape <<= 1;
        }
        lut[lutIdx] = mask;
    }
