template <class T> __attribute__((device)) __inline__ void sortShared(T* ptr, int numItems)
{
    int thrInBlock = threadIdx.x + threadIdx.y * blockDim.x;
    int range = 16;



    int base = thrInBlock * 2;
    if (base < numItems - 1)
    {
        bool tryOdd = (base < numItems - 2 && (~base & (range - 2)) != 0);
        T mid = ptr[base + 1];

        for (int iter = 0; iter < range; iter += 2)
        {


            T tmp = ptr[base + 0];
            if (tmp > mid)
            {
                ptr[base + 0] = mid;
                mid = tmp;
            }



            if (tryOdd)
            {
                tmp = ptr[base + 2];
                if (mid > tmp)
                {
                    ptr[base + 2] = mid;
                    mid = tmp;
                }
            }
        }
        ptr[base + 1] = mid;
    }



    for (; range < numItems; range <<= 1)
    {



        __syncthreads();

        T item;
        int slot;
        if (thrInBlock < numItems)
        {
            item = ptr[thrInBlock];
            slot = (thrInBlock & -range) ^ range;
            if (slot < numItems)
            {
                T tmp = ptr[slot];
                bool inclusive = ((thrInBlock & range) != 0);
                if (tmp < item || (inclusive && tmp == item))
                {
                    for (int step = (range >> 1); step != 0; step >>= 1)
