template <int SamplesLog2>
__attribute__((device)) __inline__
void computeBarys( Vec3f& bary,
                   Vec3f& baryDX,
                   Vec3f& baryDY,
                   const Vec3i& wpleq,
                   const Vec3i& upleq,
                   const Vec3i& vpleq,
                   int sampleX,
                   int sampleY)
{
    F32 w = 1.0f / (F32)(wpleq.x * sampleX + wpleq.y * sampleY + wpleq.z);
    F32 u = w * (F32)(upleq.x * sampleX + upleq.y * sampleY + upleq.z);
